var arr = ['a', 'A', 'b', 'B'];
arr.sort(function(a, b) {
  if (a.toLowerCase() < b.toLowerCase()) return -1;
  if (a.toLowerCase() > b.toLowerCase()) return 1;
  if (a < b) return -1;
  if (a > b) return 1;
console.log(arr);
